Working Environment:
Operating Temperature: -20℃ ~ 50℃;
			Storage Temperature: -40℃ ~ 80℃; 
			Operating Humidity: Max 90%, non-condensing
			Storage Humidity: Max 95%, non-condensing
			Working Height: Max to 10,000 feet (3,000 meters)
			Storage Height: Max to 10,000 feet (3,000 meters)

DIP Switch:
VLAN：Port Isolation, 1-4 ports are isolated each other, all communicate with uplink port 5;
Default：Default mode, Support loop alarm;
			Extend：Monitor Mode, 1-4 ports support 100M speed reduction negotiation, support 250 meters in 10Mbps/s mode,  port 7 and port 8 as uplink port

VLAN：Port Isolation, 1-6 ports are isolated each other, all communicate with uplink port 7/8;
Default：Default mode, Support loop alarm;
			Extend：Monitor Mode, 1-6 ports support 100M speed reduction negotiation, support 250 meters in 10Mbps/s mode,  port 7 and port 8 as uplink port
